Mz("common/buffer.effekt",'module buffer\n\nimport array\n\n// TODO (in Effekt compiler)\n// - [ ] fix exceptions on objects\n// - [X] allow omitting braces after `at` for singleton regions\n\nrecord BufferOverflow()\n\n/// Fixed-size ring buffers (queues) where one can write\n/// elements to the head and read from the tail.\ninterface Buffer[T] {\n  /// The remaining capacity\n  def capacity(): Int\n\n  /// Is this buffer full?\n  def full?(): Bool\n\n  /// Is this buffer empty?\n  def empty?(): Bool\n\n  /// Read an element from the tail of the buffer\n  def read(): Option[T]\n\n  /// Write an element to the head of the buffer\n  def write(el: T): Unit / Exception[BufferOverflow]\n}\n\ndef emptyBuffer[T](capacity: Int): Buffer[T] at global \x3d {\n  if (capacity \x3d\x3d 1) refBuffer()\n  else arrayBuffer(capacity)\n}\ndef arrayBuffer[T](initialCapacity: Int): Buffer[T] at global \x3d {\n  // TODO allocate buffer (and array) into a region r.\n  val contents \x3d array::allocate[T](initialCapacity)\n  val head \x3d ref(0)\n  val tail \x3d ref(0)\n\n  def size(): Int \x3d\n    if (tail.get \x3e\x3d head.get) { tail.get - head.get }\n    else { initialCapacity - head.get + tail.get }\n\n  def capacity(): Int \x3d initialCapacity - size()\n\n  def buffer \x3d new Buffer[T] {\n    def capacity() \x3d capacity()\n    def full?() \x3d capacity() \x3c\x3d 0\n    def empty?() \x3d size() \x3c\x3d 0\n    def read() \x3d {\n      if (buffer.empty?) None()\n      else {\n        val result: T \x3d contents.unsafeGet(head.get)\n        head.set(mod(head.get + 1, initialCapacity))\n        Some(result)\n      }\n    }\n    def write(el: T) \x3d {\n      if (buffer.full?) \x3c\x3e // raise(BufferOverflow())\n\n      contents.unsafeSet(tail.get, el)\n      tail.set(mod(tail.get + 1, initialCapacity))\n    }\n  }\n  buffer\n}\ndef refBuffer[T](): Buffer[T] at global \x3d {\n  val content \x3d ref(None())\n  new Buffer[T] {\n    def capacity() \x3d if (content.get.isEmpty) 1 else 0\n    def full?() \x3d content.get.isDefined\n    def empty?() \x3d isEmpty(content.get)\n    def read() \x3d {\n      val res \x3d content.get\n      content.set(None())\n      res\n    }\n    def write(el: T) \x3d content.get match {\n      case Some(v) \x3d\x3e\n        \x3c\x3e // do raise(BufferOverflow(), "Cannot read element from buffer")\n      case None() \x3d\x3e\n        content.set(Some(el))\n    }\n  }\n}\n\nnamespace examples {\n  def main() \x3d ignore[BufferOverflow] {\n    // Buffer with capacity 1\n    def b \x3d emptyBuffer[Int](1)\n    println(b.capacity)\n    println(b.full?)\n\n    b.write(17)\n    println(b.read())\n\n    // buffer with capacity 3\n    def ringbuffer \x3d emptyBuffer[Int](3)\n    ringbuffer.write(1)\n    ringbuffer.write(2)\n    println(ringbuffer.read())\n    ringbuffer.write(3)\n    println(ringbuffer.read())\n    println(ringbuffer.read())\n    ringbuffer.write(4)\n    ringbuffer.write(5)\n    println(ringbuffer.read())\n    println(ringbuffer.read())\n  }\n}\n');
